import React from 'react';
import { Link } from 'react-router-dom';
import { NavbarSection , Logo , LogoText , UlList , ListItem , Anchor  } from './style';

const LinkNewStyle  =  {
    display: 'block',
    color: '#222',
    textDecoration: 'none',
    padding: '10px 15px',
    fontWeight: 'bold'
    
}

const Navbar =() => {
  return (
    <NavbarSection>
        
        <div className="container">
            
            <Logo>
                <LogoText>Ultra Profile</LogoText>
            </Logo>
            
            <UlList>
                <ListItem><Link style= {LinkNewStyle} to="/">Home</Link></ListItem>
                <ListItem><Anchor>Work</Anchor></ListItem>
                <ListItem><Anchor>Portfolio</Anchor></ListItem>
                <ListItem><Anchor>Resume</Anchor></ListItem>
                <ListItem><Anchor>About</Anchor></ListItem>
                <ListItem><Link style= {LinkNewStyle} to="/contact">Contact</Link></ListItem>
            </UlList>
            
        </div>
    </NavbarSection>
  );
}

export default Navbar;
